const e=JSON.parse('{"key":"v-4c924008","path":"/reading/algorithm/offer_oriented/AL_DS/13_backtracking/13.1.html","title":"13.1 回溯法基础","lang":"zh-CN","frontmatter":{"title":"13.1 回溯法基础","date":"2023-09-15T00:00:00.000Z","category":["algorithm"]},"headers":[{"level":2,"title":"Reference","slug":"reference","link":"#reference","children":[]}],"readingTime":{"minutes":0.47,"words":140},"filePathRelative":"reading/algorithm/offer_oriented/AL_DS/13_backtracking/13.1.md","localizedDate":"2023年9月15日","excerpt":"<p>回溯法在解决问题时, 每一步都将尝试不同的可能性, 最后将尝试所有的解决方案.</p>\\n<p>回溯法的步骤可用树形表示, 每一个叶节点就代表了一个解决方案. 那么深度优先遍历就适用于回溯法.</p>\\n<p>若子树可以跳过以优化效率, 跳过子树就称为剪枝.</p>\\n<p>回溯法通常使用递归的形式.</p>\\n<h2> Reference</h2>\\n<ol>\\n<li><a href=\\"https://book.douban.com/subject/35543447/\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">剑指Offer（专项突破版）</a></li>\\n</ol>"}');export{e as data};
